import './ExpenseItem.css'

function ExpenseItem({expense}) {
    console.log(expense)
    return (
        <div className="expense-item">
            <div>{expense[0].expenseDate.toISOString()}</div>
            <div className="expense-item__description">
                <h2>{expense[0].expenseTitle}</h2>
                <div className="expense-item__price">${expense[0].expensePrice}</div>
            </div>
        </div>
    );
}

export default ExpenseItem
